import Btn from "./Btn";
import { useEffect, useState } from "react";

function Hello() {
  return <h1>Hello</h1>;
}

function App() {
  const [value, setValue] = useState(0);
  const cntup = () => {
    setValue((now) => now + 1);
  };
  const [check, setCheck] = useState();

  return (
    <div>
      <h1>Welcome Back!!!!</h1>
      <Btn />
      <div>
        <br />
        <br />
        <button onClick={cntup}>count up</button>
        <h3>{value}</h3>
      </div>
    </div>
  );
}

export default App;
